import './ProductData'

const useStyles = makeStyles({
  center:{
    display:'flex',
    justifyContent:'center',
    marginTop:"12vh"
    
  }
})

const cards = [
    {
      id: 1,
      img: product1,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 2,
