      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 8,
      img: product8,
      title: "hgvhgc",
      description: "vghcg",
    },
    {
      id: 9,
      img: product9,
      title: "hgvhgc",
      description: "vghcg",
    },
  ];
 

const Products = () => {
  const classes = useStyles();
    return (
      <>
      <Navbar/>
        <Box display='flex'>
        <Grid container spacing={5} className={classes.center} >
            
            {cards.map((card,id) => {
                return(
                   <Grid key={id} item> <Product  {...card}/> </Grid>
                )
              }
            )
            }
            
        </Grid>
        </Box>
        </>
    )
}

export default Products
